import React from "react";
import { Container, Row, Col, Navbar, Nav } from "react-bootstrap";
import "../styling/hero.css";

export const Hero: React.FC = () => {
  return (
    <div className="hero-section">
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">thenujastore</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link1">Link 1</Nav.Link>
              <Nav.Link href="#link2">Link 2</Nav.Link>
              <Nav.Link href="#link3">Link 3</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <div className="flex gap-4">
        {[
          [24, 32, 32, 16, 16],
          [32, 40, 56],
          [64, 32, 32],
        ].map((card, index) => (
          <div className="flex-1" key={index}>
            {card.map((height, index) => (
              <div
                className={`mb-4 h-${height} rounded-xl border-2 border-slate-400/10 bg-neutral-100 p-4 dark:bg-neutral-900`}
                key={index}
              ></div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};
